        public static string HandWinNumColorFor6(string num, string openNum, int sort)
        {
            string[] numArr = num.Split(' ');
            string[] openArr = openNum.Split(',');

            string result = "";

            //重新组装
            if (sort < 3 || sort == 6)
            {
                if (sort == 0)
                {
                    string openNum2 = openNum.Substring(0, openNum.Length - 3);

                    foreach (string s in numArr)
                    {
                        if (openNum2.Contains(s))
                        {
                            result += "<font class='Mif_titred'>" + s + "</font> ";
                        }
                        else
                        {
                            result += s + " ";
                        }
                    }

                }
                else if (sort == 1)
                {
                    foreach (string s in numArr)
                    {
                        int count = 0;

                        foreach (string s1 in openArr)
                        {
                            if (s1.EndsWith(s))
                            {
                                count++;
                            }
                        }

                        if (count > 0)
                        {
                            result += "<font class='Mif_titred'>" + s + "</font> ";
                        }
                        else
                        {
                            result += s + " ";
                        }
                    }

                }
                else if (sort == 2)
                {
                    string texiao = Util.GetShengxiaoByDigit(int.Parse(openArr[6]));

                    foreach (string s in numArr)
                    {
                        if (s == texiao)
                        {
                            result += "<font class='Mif_titred'>" + s + "</font> ";
                        }
                        else
                        {
                            result += s + " ";
                        }
                    }
                }
                else if (sort == 6)
                {
                    string tema = openArr[6];

                    foreach (string s in numArr)
                    {
                        if (s == tema)
                        {
                            result += "<font class='Mif_titred'>" + s + "</font> ";
                        }
                        else
                        {
                            result += s + " ";
                        }
                    }
                }

                return result.TrimEnd();
            }
            else
            {
                return num;
            }
        }

        public static string HandWinNumColor(string num, string openNum, int index)
        {
            string[] numArr = num.Split(' ');
            string[] openArr = openNum.Split(',');

            string temp = openArr[index];

            //重新组装
            string result = "";

            for (int i = 0; i < numArr.Length; i++)
            {
                if (temp == numArr[i])
                {
                    result += "<font class='Mif_titred'>" + numArr[i] + "</font> ";
                }
                else
                {
                    result += numArr[i] + " ";
                }
            }

            return result.TrimEnd();
        }

