            else if (lType == 7)
            {
                count = 5;
            }
            else if (lType == 2 || lType == 4 || lType == 8)
            {
                count = 7;
            }

            return count;
        }


        //随机一个数字
        public static int RandomANum(int a, int b)
        {
            long tick = DateTime.Now.Ticks;
            Random ran = new Random((int)(tick & 0xffffffffL) | (int)(tick >> 32));

            int temp = ran.Next(a, b);

            return temp;

        }

        public static string GetTeXiao(string num)
        {
            string result = "";
            string[] texiaoArr = { "鼠", "牛", "虎", "兔", "龙", "蛇", "马", "羊", "猴", "鸡", "狗", "猪" };
            string[] numArr = num.Split(' ');

            foreach (string s in numArr)
            {
                result += texiaoArr[int.Parse(s)] + " ";
            }

            return result.TrimEnd();
        }


        //将小于10的输 转化为两位数
        public static string HandTwoWeiNum(string num)
        {
            string result = "";
            string[] arr = num.Split(' ');

            foreach (string s in arr)
            {
                string temp = "";
                if (s.Length == 1)
                {
                    temp = "0" + s;
                }
                else
                {
                    temp = s;
                }

                result += temp + " ";
            }

            return result.TrimEnd();
        }


        public static string RandomNum(int a, int b, int len)
        {

            long tick = DateTime.Now.Ticks;
            Random ran = new Random((int)(tick & 0xffffffffL) | (int)(tick >> 32));

            List<int> inumber = new List<int>();

            for (int i = 0; i < len; i++)
            {
                Thread.Sleep(100);

                int temp = ran.Next(a, b);
                while (inumber.Contains(temp))
                {
                    temp = ran.Next(a, b);
                }

                inumber.Add(temp);
            }

            //Array.Sort(inumber);

            inumber.Sort();

            string code = String.Join(" ", inumber);
            return code;

        }


        //开奖号码 数字 转化为生肖
        public static string ChangeOpenNumToShengxiao(string openNum)
        {
            string[] arr = openNum.Split(',');
            string result = "";

            foreach (string s in arr)
            {
                int num = int.Parse(s);
                result += GetShengxiaoByDigit(num) + ",";
            }

            return result.TrimEnd(',');
        }

