        //处理PC蛋蛋的号码
        public static string HandNumForKL8(string num)
        {
            string[] arr = num.Split(',');


            int one = 0;
            int two = 0;
            int three = 0;

            for (int i = 0; i < arr.Length; i++)
            {
                int temp = int.Parse(arr[i]);

                if (i >= 0 && i < 6)
                {
                    one += temp;
                }
                else if (i >= 6 && i < 12)
                {
                    two += temp;
                }
                else if (i >= 12 && i < 18)
                {
                    three += temp;
                }
                else
                {
                    break;
                }
            }

            one = one % 10;
            two = two % 10;
            three = three % 10;

            string result = one + "," + two + "," + three;

            return result;
        }

        //采集号码
        public static string CaiJiNum(string url)
        {
            WebClient wc = new WebClient();

            try
            {
                byte[] buffer = wc.DownloadData(url);
                MemoryStream ms = new MemoryStream(buffer);

                // 解析xml
                XmlDocument xmlDocument = new XmlDocument();
                xmlDocument.Load(ms);
                XmlNode root = xmlDocument.SelectSingleNode("xml");
                XmlNodeList nodeList = root.ChildNodes;
                XmlNode node = nodeList.Item(0); //目前只取第一条数据
                string issue = node.Attributes.Item(0).Value; //期号
                string num = node.Attributes.Item(1).Value;

                return issue + "|" + num;
            }
            catch (Exception ex)
            {
                wc.Dispose();
            }

            return "";
        }

